import React from 'react';
import './work.css';


function Work(props) {
    console.log(props.data);
    const work = props.data;
    const listWorks = work.map((item, i)=>
         <div key = {i} >

            <div>
                {item.position}
            </div> 

         </div>
    )
    return (
        <div className="Work">
            {listWorks}
        </div>
    )
}

export default Work;
